n=int(input())
a=list(map(int,input().split()))
def doo(i):
    global a,n
    k=0
    for k in range(1,n-i):
        if(a[k+i]==1):
            break
    kk=0
    for kk in range(1,i+1):
        if(a[i-kk]==1):
            break
    return (k+1)*(kk+1)
s=0
for i in range(n):
    if(a[i]==1):
        s+=doo(i)
        #print(s)
print(s)

